import React from 'react';
import { Table } from 'reactstrap';

const TableR = (props) => {
    return (
        <Table bordered>
            <thead>
            <tr>
                <th>#</th>
                <th>First Name</th>
                <th>Last Name</th>
                <th>Username</th>
            </tr>
            </thead>
            <tbody>
            <tr>
                <th scope="row">3</th>
                <td>Larry</td>
                <td>the Bird</td>
                <td>@twitter</td>
            </tr>
            </tbody>
        </Table>
    );
}

export default TableR;
